import { useState } from "react";

async function GetDataJson(subject) {
  const response = await fetch(
    "https://www.googleapis.com/books/v1/volumes?q=subject:" + subject
  );

  const allRes = response.json();
  var booksOofCategory = [];
  allRes.then((val) => {
    val.items.map((book) => booksOofCategory.push(book.id));
  });
  return booksOofCategory;
}

function Layout() {
  const [data, setData] = useState("Null");
  setData(GetDataJson("Fiction"));

  return (
    <>
      <p>{}</p>
    </>
  );
}

export default Layout;
